Config.GuildSecretAreaData.data_explain = {
	[1] = {id=1, title="基础规则", desc="1.公会秘境为仅限同一个公会的成员可以讨伐的限时团体副本玩法，秘境的领主共有<div fontcolor=#d95014>5</div>个，公会成员间可以互相协商并选定讨伐目标，由会长或副会长开启副本，所有成员共同参与讨伐\n2.讨伐开启后，共有<div fontcolor=#d95014>24</div>小时的讨伐时间，<div fontcolor=#d95014>24</div>小时过后系统会进行结算，此时若领主的血量归零，则视为讨伐成功，否则则视为讨伐失败  \n3.若领主在结算前血量就被削减至0点，直至本次讨伐结算前，玩家仍可选择<div fontcolor=#d95014>追击</div>领主，且追击会正常消耗挑战次数  \n4.秘境领主的难度有多个，若讨伐成功则会提升该领主难度，若讨伐失败会降低该领主的难度，领主难度越高，该玩法产出的奖励便会越丰厚"},
	[2] = {id=2, title="玩法奖励", desc="1.<div fontcolor=#d95014>挑战奖励</div>：每次挑战领主都可获得挑战奖励，挑战奖励不会随着领主难度的提升而增多  \n2.<div fontcolor=#d95014>排行奖励</div>：讨伐结束后，系统会根据玩家本次讨伐过程中对领主造成的伤害排行结算相应的奖励，该奖励只会结算给参与过讨伐的公会成员  \n3.<div fontcolor=#d95014>公会宝库奖励</div>：若成功击杀领主则会获得公会宝库奖励，这部分奖励物品不会直接放入玩家的背包，而是放入公会宝库中成为可供玩家兑换的商品。公会宝库奖励分为固定掉落奖励和随机掉落奖励，固定掉落奖励为必定掉落，随机掉落奖励为从奖励池中随机抽取<div fontcolor=#d95014>1</div>件物品掉落，奖励内容请详见<div fontcolor=#d95014>查看奖励</div>  \n4.<div fontcolor=#d95014>阶段宝箱奖励</div>：当领主的生命值分别削减至<div fontcolor=#d95014>60%</div>，<div fontcolor=#d95014>30%</div>和<div fontcolor=#d95014>0%</div>时会解锁对应的奖励宝箱，只有参与过讨伐的公会成员才可领取，且秘境重置后奖励宝箱也会随之重置"},
	[3] = {id=3, title="秘境重置", desc="1.讨伐结算后，秘境会有着<div fontcolor=#d95014>24</div>小时的冷却时间，在此期间内，秘境讨伐无法再次被开启\n2.秘境开启后，会重置挑战次数。且每次重置挑战次数后都会有着<div fontcolor=#d95014>48</div>小时的冷却时间，在此期间内，玩家的挑战次数不会被再次重置"}
}
